/* prettier-ignore-file */

import { useState } from "react";

// @mui material components
import Card from "@mui/material/Card";
import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";

// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import MDButton from "components/MDButton";
import MDTooltip from "components/MDTooltip";
// prettier-ignore

import {
  Box,
  Accordion,
  AccordionSummary,
  AccordionDetails,
} from "@mui/material";

// Material Dashboard 2 React examples
import DataTable from "examples/Tables/DataTable";

// Data
import data from "layouts/dashboard/components/Projects/data";

function Converter() {
  const { columns, rows } = data();
  const [menu, setMenu] = useState(null);
  const commonStyles = {
    accordion: {
      // border: "1px solid #340CB9",
      borderRadius: "5px",
      marginBottom: "5px",
    },
    accordionSummary: {
      height: "40px",
      minHeight: "40px",
    },
    mdBox: {
      display: "flex",
      flexDirection: "row",
      justifyContent: "center",
      alignItems: "center",
    },
    roundBox: {
      width: 25,
      height: 25,
      borderRadius: "50%",
      backgroundColor: "transparent",
      border: "1px solid grey",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
    },
  };

  const openMenu = ({ currentTarget }) => setMenu(currentTarget);
  const closeMenu = () => setMenu(null);

  const renderMenu = (
    <Menu
      id="simple-menu"
      anchorEl={menu}
      anchorOrigin={{
        vertical: "top",
        horizontal: "left",
      }}
      transformOrigin={{
        vertical: "top",
        horizontal: "right",
      }}
      open={Boolean(menu)}
      onClose={closeMenu}
    >
      <MenuItem onClick={closeMenu}>Action</MenuItem>
      <MenuItem onClick={closeMenu}>Another action</MenuItem>
      <MenuItem onClick={closeMenu}>Something else</MenuItem>
    </Menu>
  );

  return (
    // prettier-ignore

    <Card>
      <MDBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <MDBox>
          <MDTypography variant="h5" gutterBottom>
            EDI-TO-FHIR CONVERTER
          </MDTypography>
          <MDBox display="flex" alignItems="center" lineHeight={0}>
            {/* <Icon
              sx={{
                fontWeight: "bold",
                color: ({ palette: { info } }) => info.main,
                mt: -0.5,
              }}
            >
              done
            </Icon> */}
            {/* <MDTypography variant="button" fontWeight="regular" color="text">
              &nbsp;<strong>30 done</strong> this month
            </MDTypography> */}
          </MDBox>
        </MDBox>
        <MDBox color="text" px={2}>
          <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small" onClick={openMenu}>
            more_vert
          </Icon>
        </MDBox>
        {renderMenu}
      </MDBox>
      <MDBox>
        {/* <DataTable
          table={{ columns, rows }}
          showTotalEntries={false}
          isSorted={false}
          noEndBorder
          entriesPerPage={false}
        /> */}

        <Accordion
          style={{
                  ...commonStyles.accordion,
                  border:
                    dataStore.step >= 0
                      ? "1px solid #340CB9"
                      : "1px solid #d8d8d8",
                  marginBottom: "20px",
                }}
                expanded={expandedAccordion === "accordion1"}
                onChange={() =>
                  setExpandedAccordion(
                    expandedAccordion === "accordion1" ? "" : "accordion1"
                  )
                }
              >
                <AccordionSummary
                  // expandIcon={<ExpandMoreIcon />}
                  aria-controls={`1-content`}
                  id={`1-header`}
                  style={commonStyles.accordionSummary}
                >
                  <MDBox sx={{ ...commonStyles.mdBox, gap: `120px`,color: "#525f7f" }}>
                    <MDBox sx={{ ...commonStyles.mdBox, gap: "10px",color: "#525f7f" }}>
                      <Box
                        sx={{
                          width: 25,
                          height: 25,
                          borderRadius: "50%",
                          backgroundColor:
                            dataStore.selectedBucket === ""
                              ? "transparent"
                              : "#17A948",
                          border:
                            dataStore.selectedBucket === ""
                              ? "1px solid grey"
                              : "1px solid #17A948",
                          display: "flex",
                          alignItems: "center",
                          justifyContent: "center",
                        }}
                      >
                        <MDTypography
                          variant="button"
                          fontWeight="light"
                          color={
                            dataStore.selectedBucket === "" ? "dark" : "white"
                          }
                        >
                          1
                        </MDTypography>
                      </Box>
                      {/* <MDTypography
                        variant="button"
                        fontWeight="light"
                        color="dark"
                      >
                        Select
                      </MDTypography> */}

                      {/* Insert code block for tooltip */}
                      <MDTooltip 
                        text= "Select" 
                        tooltipText="Specify S3 Bucket path to get started with validation and conversion stage" 
                      />

                    </MDBox>
                    {/* {matches && (
                      <MDTypography
                        // variant="button"
                        // fontWeight="light"
                        // color="dark"
                        variant="button"
                        fontWeight="bold"
                        color={dataStore.selectedBucket === "" ? "error" : "primary"}
                        sx={{
                          padding: "8px 16px",
                          borderRadius: "8px",
                          backgroundColor: dataStore.selectedBucket === "" ? "#f8d7da" : "#e0f7fa",
                          border: dataStore.selectedBucket === "" ? "2px solid #f5c6cb" : "2px solid #80deea",
                          boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
                          transition: "all 0.3s ease-in-out",
                          "&:hover": {
                            backgroundColor: dataStore.selectedBucket === "" ? "#f5c6cb" : "#b2ebf2",
                            boxShadow: "0px 6px 10px rgba(0, 0, 0, 0.2)",
                          },
                        }}
                      >
                        {dataStore.selectedBucket === ""
                          ? "Specify S3 Bucket path to get started with validation and conversion stage"
                          : dataStore.selectedBucket}
                      </MDTypography>
                    )} */}
                  </MDBox>
                </AccordionSummary>
                <AccordionDetails
                  style={{
                    minHeight: "200px",
                    display: "flex",
                    flexDirection: "column",
                    justifyContent: "space-between",
                  }}
                >
                  <MDBox
                    sx={{
                      marginTop: "20px",
                    }}
                  >
                    {/* <BucketSelector
                      dataStore={dataStore}
                      selectedBucket={selectedBucket}
                      setSelectedBucket={setSelectedBucket}
                    /> */}
                  </MDBox>
                  <MDButton
                    variant="gradient"
                    color="success"
                    sx={{
                      width: 100,
                      ml: 5,
                      mr: 5,
                      alignSelf: "flex-end",
                      borderRadius: 10,
                    }}
                    disabled={dataStore.selectedBucket === ""}
                    onClick={() => {
                      setExpandedAccordion("accordion2");
                      dataStore.changeStep(1);
                    }}
                  >
                    Save
                  </MDButton>
                </AccordionDetails>
              </Accordion>

      </MDBox>
    </Card>
  );
}

export default Converter;
